<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>Eclipse</b> est un environnement de dveloppement intgr (IDE) utilis dans la programmation informatique. Il contient un espace de travail de base et un systme de plug-in extensible pour personnaliser l'environnement. Il s'agit du deuxime IDE le plus populaire pour le dveloppement Java et, jusqu'en 2016, il tait le plus populaire. Eclipse est crit principalement en Java et son utilisation principale est le dveloppement d'applications Java, mais il peut galement tre utilis pour dvelopper des applications dans d'autres langages de programmation via des plug-ins, notamment Ada, ABAP, C, C++, C#, Clojure, COBOL, D, Erlang, Fortran, Groovy, Haskell, JavaScript, Julia, Lasso, Lua, NATURAL, Perl, PHP, Prolog, Python, R, Ruby ( y compris Ruby on Rails framework), Rust, Scala et Schma. Il peut galement tre utilis pour dvelopper des documents avec LaTeX (via un plug-in TeXlipse) et des packages pour le logiciel Mathematica. Les environnements de dveloppement incluent les outils de dveloppement Java Eclipse (JDT) pour Java et Scala, Eclipse CDT pour C/C++ et Eclipse PDT pour PHP, entre autres.

La base de code initiale provenait d' IBM VisualAge. Le kit de dveloppement logiciel (SDK) Eclipse, qui comprend les outils de dveloppement Java, est destin aux dveloppeurs Java. Les utilisateurs peuvent tendre ses capacits en installant des plug-ins crits pour la plate-forme Eclipse, tels que des kits d'outils de dveloppement pour d'autres langages de programmation, et peuvent crire et contribuer leurs propres modules de plug-in. Depuis l'introduction de l' implmentation OSGi (Equinox) dans la version 3 d'Eclipse, les plug-ins peuvent tre branchs-arrts dynamiquement et sont appels bundles (OSGI). Le kit de dveloppement logiciel (SDK) Eclipse est un logiciel gratuit et open source , publi selon les termes de la licence publique Eclipse, bien qu'il soit incompatible avec la licence publique gnrale GNU. C'tait l'un des premiers IDE  fonctionner sous GNU Classpath et il fonctionne sans problme sous IcedTea.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
