<h1 class="Section4">
<a class="Section5" href="#" id="pdt">PDT</a>
</h1>
<div class="Section6"><br>PHP Development Tools (<b>PDT</b>) est un plugin IDE de langage pour la plateforme Eclipse et le projet open source qui le dveloppe.

Le projet vise  englober tous les outils ncessaires pour dvelopper des logiciels bass sur PHP. Il utilise le projet Eclipse Web Tools existant pour fournir aux dveloppeurs des fonctionnalits PHP. Tous ces outils PHP sont faciles  utiliser et les dveloppeurs peuvent acclrer le processus de dveloppement en utilisant ces outils. Des plugins supplmentaires sont disponibles en tant qu'extensions PDT. PDT offre comme fonctionnalits cls, un diteur PHP, la mise en vidence de la syntaxe, un assistant de contenu, un formateur de code, le refactoring, les modles de code, une navigation dans le code simple et puissante, un dbogage et profilage, la validation de la syntaxe.<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
