</h1>
<div class="Section6"><br><b>Xdebug</b> est une extension logicielle pour PHP apportant des fonctions de dbogage et de profilage. Elle utilise le protocole DBGp. Xdebug propose l'excution du code PHP pas  pas, selon des points d'arrt, le traage des appels des messages d'erreur, la protection contre les boucles infinies, le profilage du code, l'analyse de la couverture de code, le dbogueur front-end.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
